import React from 'react';
import './Header.css';
import {Link } from "react-router-dom";

function Header(){
    return(
        <div className="header">
            <div className="logo_arman">
                <Link to="/main"><img src="https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwjQ6LjsoIXnAhXl8KYKHetNDpEQjRx6BAgBEAQ&url=https%3A%2F%2Ficonproducts.com%2Fforbes-interviews-jorge-rubin%2Fforbes-logo%2F&psig=AOvVaw0vE25IMrAsCot5ljYq1QPK&ust=1579165711585510" alt=""/></Link>
            </div>
            <div className="navbar">
                <Link>Billionaires</Link>
                <Link>Innovation</Link>
                <Link>Leadership</Link>
                <Link>Money</Link>
                <Link>Business</Link>
                <Link>Small Business</Link>
                <Link>Lifestyle</Link>
                <Link>Lists</Link>
                <Link>Advisor</Link>
                <Link>Featured</Link>
                <Link>Breaking</Link>
                <Link>More</Link>
            </div>
        </div>
    );
}

export default Header;
